import Nav from "./nav"
import '../style/Style.css';
import '../style/sass/home.scss';
import Head from 'next/head';
const Layout = (props)=>{
return(
    <div>
        <Head>
            <title>
                AGIT Frontend Test
            </title>
            <Link rel=""/>
        </Head>
        <Nav/>
        {props.children}
    </div>
)
}
export default Layout;
